import React from 'react'
import Categories from './Categories'

export default function CategoryContainer(props) {



    // let arrCategories = props.categories.map((categories) => {
    //     return <Categories key={categories.id} name={categories.name} duration={categories.duration}/>
    // })

    const renderCategoryNames = props.categories.map((category) => { return <tr>{category.name}</tr>})

    const renderCategoryDuration = props.categories.map((category) => (<tr> {category.duration}</tr>))

    // console.log(arrCategories)

    return (
        <div>
            <table className="table">
            <thead>
                    <tr>
                        <th>Category</th>
                        <th>Hours</th>
                        <th>Edit</th>
                        <th>Delete</th>
                    </tr>
                </thead>

                <tbody>
                    <tr>
                        <td>{renderCategoryNames}</td>
                        <td>{renderCategoryDuration}</td>
                        <td><button>Edit</button></td>
                        <td><button>Delete</button></td>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}
